export function PartOne({show, setShow}) {

  return (
    <>
      {show ? <div>partOne</div> : null}
      <button
        onClick={() => {
          setShow(!show);
        }}>
        show partOne
      </button>
    </>
  );
}

export function PartTwo({show, setShow}) {
